import axios from "axios";

const params = {
    headers: {
        Authorization: "bearer " + '74033186c656ca034067a3433baa478811cbeb22599ef05534f5e801dcc1abd28a1f3b675b911b2477283e8b8b9fbd90c7bc97ddc2f1987f63f9aaf2fb9c6b1da1a142ff709b9d34de1783aecfc2960602784cf4360cdcfe7add715b85e2e98a232a794a563e6f96994cac0af74081a8246b0df96919600563123c2296c83413',
    },
};

export const fetchDataFromApi = async (url) => {
    try {
        const { data } = await axios.get(process.env.REACT_APP_DEV_URL + url , params);
        return data;
    } catch(error) {
        console.log(error)
        return error
    }
}
